import React from "react";
import { TransitionGroup } from "react-transition-group";
import "../css/index.css";
import logo from "../img/logo.png";

function Welcome() {
  return (
    <CSSTransitionGroup
    transitionName="Test"
          transitionEnterTimeout={500}
          transitionLeaveTimeout={300}>
    <table className="index-welcome index index-odd">
      <tbody>
        <tr>
          <td>
            <div
              className="initial-intro"
              id="intro-div"
              //   style={{paddingBottom: 15 + "vh"}}
            >
              <img
                className="initial-pic"
                src={logo}
                alt="Banner for devonmartin.net"
              />
              <h2>Hey. I'm Devon.</h2>
              <h2>I'm a self-taught software engineer.</h2>
              <div>
                <a className="btn btn-lg m-0" href="#index-2">
                  Who?
                </a>
              </div>
            </div>
          </td>
        </tr>
      </tbody>
    </table>
    </CSSTransitionGroup>
  );
}

export default Welcome;
